// client/src/pages/About/About.js
import React from 'react';
import './About.css';

export default function About() {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>
        We’re Maria Elheeb and Yazan Dawud—two developers passionate about
        building clean, modern web experiences with React, Node.js, and more.
      </p>
      <p>
        Here you can learn about our backgrounds, skillsets, and how we
        collaborate on projects.
      </p>
    </div>
  );
}
